def multiply_primes(n, m):

    def is_prime(num):
        if num <= 1:
            return False
        if num == 2:
            return True
        if num % 2 == 0:
            return False
        sqr = int(num ** 0.5) + 1
        for divisor in range(3, sqr, 2):
            if num % divisor == 0:
                return False
        return True
    if not (isinstance(n, int) and n > 0) and (not (isinstance(m, int) and m > 0)):
        return 'Invalid input'
    primes_found = 0
    current_number = 2
    product = 1
    while primes_found < n:
        if current_number > m:
            return 'Not enough primes found within the provided limit'
        if is_prime(current_number):
            product *= current_number
            primes_found += 1
        current_number += 1
    return product

